import React from 'react';
import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader
import { Carousel } from 'react-responsive-carousel';
import '../../../pages/images.css';

export const Technologies = () => {
    return (
        <Carousel>
            <div className={'carousel-img carousel-img--react'}></div>
            <div className={'carousel-img carousel-img--ang'}></div>
            <div className={'carousel-img carousel-img--vue'}></div>
            <div className={'carousel-img carousel-img--redux'}></div>
            <div className={'carousel-img carousel-img--node'}></div>
            <div className={'carousel-img carousel-img--docker'}></div>
            <div className={'carousel-img carousel-img--mongo'}></div>
            <div className={'carousel-img carousel-img--postgress'}></div>
        </Carousel>
    )
};

export default Technologies;
